import React from "react";
import web from "../src/images/it_building.jpg";
// import { NavLink } from "react-router-dom";
import Typical from 'react-typical';


const Home = () => {

return(
    <>
      <section id= "header" className="d-flex align-items-center" >
        <div className="container-fluid nav_bg center-div" >
            <div className="row" >
                 <div className="col-12 mx-auto" >
                     <div className="row">
                     <div className="text-white d-flex justify-content-center flex-column text-center animated">
                         <h1> Painting </h1>
                          <h2 className="my-3 text-capitalize"> Join us<span>
                              <Typical
                                steps={['order now',5000,'order now',4000]}
                                loop={Infinity}
                                wrapper="h2"
                            />
                            </span>
                         </h2>
                     </div>
       <form className="form-inline my-2 my-lg-0 col-6 col-lg-2 col-sm-12 d-flex flex-row justify-content-center align-items-center p-1">
                    <input className="form-control mr-2 col-6" type="text" placeholder="Search by Category" aria-label="Search" />
                    <button className="btn btn-outline-success float-right my-2 my-sm-0 col-6 col-lg-8" type="submit">Search</button>
                    </form>
                 </div>
             </div>
             </div>
       </div>
      </section>
      

    </>
);
};
export default Home;
